    console.log("selectedMeds console: ", selectedMeds)
    const uniqueArr = [...new Set(selectedMeds)]
    // const selectedMedArr = selectedMeds.map(med => <h3 key={med.rxcui} {...med}>Name: {med.name} Rxcui: {med.rxcui} </h3>)
    // const uniqueArr = selectedMedArr.filter((v, i, s) => s.indexOf(v) === i)
    // console.log("selected meds: ", selectedMedArr)
    return (

        <div>
            { uniqueArr.map(med => {
                return (
                    <div key={med.rxcui}>
                        <h3>Name: {med.name} {med.rxcui}</h3>
                    </div>
                    )
                })
            }
        </div>
    )
}

export default SelectedMedsList
